def ok(n):
    if n < 10: return n == 0
    s = str(n)
    return n == int(s[0])*int(s[1:]) + (n%10)*(n//10)
print([k for k in range(10**6) if ok(k)]) # _Michael S. Branicky_, Dec 10 2023

